MongoDB $limit inside an $and<p>I'm looking to implement a query that will return me a single JSON with 2 sets of data together.</p>
<p>What I look for is to retrieve 40 orders which offerDate is still in the future ( $gte: today ) and 8 orders which offerDate is in the past.</p>
<p>Currently I only have the 40 in the future like so:</p>
<pre><code>const orders = await db.Order.aggregate([
    {
      $match: {
        offerDate: {
          $gte: moment().startOf('day').toDate(),
        },
      },
    },
    {
      $limit: 40,
    },
</code></pre>
<p>How could I achieve to add the limit inside an $and to get both together?</p>
<p>I tried with:</p>
<pre><code>$match: {
        $and: [
          {
            offerDate: {
              $gte: moment().startOf('day').toDate(),
            },
            $limit: 40
          },
          {
            offerDate: {
              $lte: moment().startOf('day').toDate(),
            },
            $limit: 8
          },
        ]
      }
    },
</code></pre>
<p>But that didn't work at all and I cannot find the right way to do it.</p>
<p>Thanks a lot!</p>

