Update subdocument and delete array field in same mongo query<p>I am using Mongo with Node (mongoose) and I want to know if is possible execute an update and delete in the same query.</p>
<p>My model is as follow:</p>
<pre><code>{
 _id: &quot;1&quot;,
 types: [&quot;&quot;,&quot;&quot;, ...],
 items: [{
  name: &quot;item_name&quot;,
  type: &quot;type_name&quot;
 }]
}
</code></pre>
<p>A real example existing now in development DB is this model:</p>
<pre><code>{
   &quot;_id&quot;:&quot;5eff1a68c75aef6db2facdf8&quot;,
   &quot;types&quot;:[
      &quot;Tier1&quot;,
      &quot;Tier2&quot;,
      &quot;TierSpecial&quot;,
      &quot;TierSuper&quot;
   ],
   &quot;items&quot;:[
      {
         &quot;name&quot;:&quot;4x4 016 v1&quot;,
         &quot;type&quot;:&quot;Tier1&quot;
