      {
         &quot;name&quot;:&quot;Offroad example&quot;,
         &quot;type&quot;:&quot;Tier1&quot;
      },
      {
         &quot;name&quot;:&quot;Simulation super&quot;,
         &quot;type&quot;:&quot;TierSuper&quot;
      },
      {
         &quot;name&quot;:&quot;Simulation Special&quot;,
         &quot;type&quot;:&quot;TierSpecial&quot;
      }
   ]
}
</code></pre>
<p>So, I want: Update all 'type' fields in subdocuments where value is equal to a predetermined value (replace the string value). And after that delete from the array 'types'.</p>
<p>For example, with the real example, after execute the query and delete the type 'Tier1', result should be:</p>
<pre><code>{
   &quot;_id&quot;:&quot;5eff1a68c75aef6db2facdf8&quot;,
   &quot;types&quot;:[
      &quot;Tier2&quot;,
      &quot;TierSpecial&quot;,
      &quot;TierSuper&quot;
   ],
   &quot;items&quot;:[
      {
         &quot;name&quot;:&quot;4x4 016 v1&quot;,
         &quot;type&quot;:&quot;default&quot;
      },
      {
         &quot;name&quot;:&quot;Offroad example&quot;,
         &quot;type&quot;:&quot;default&quot;
      },
      {
         &quot;name&quot;:&quot;Simulation super&quot;,
         &quot;type&quot;:&quot;TierSuper&quot;
      },
      {
         &quot;name&quot;:&quot;Simulation Special&quot;,
         &quot;type&quot;:&quot;TierSpecial&quot;
      }
   ]
}
</code></pre>
<p>Note that <code>types</code> now not contais 'Tier1' and into <code>items</code>, where type were 'Tier1' now is 'default'</p>
<p>Now I can do this work, but in two queries and I'd like to do in a single one.</p>
<p>These two queries are, first one to update every <code>type</code> field that is equal to 'Tier1':</p>
<pre><code>db.collection.update({
  _id: &quot;5eff1a68c75aef6db2facdf8&quot;,

},
{
  $set: {
    &quot;items.$[elem].type&quot;: &quot;default&quot;,

  }
},
{
  arrayFilters: [
    {
      &quot;elem.type&quot;: &quot;Tier1&quot;
    }
  ]
})
</code></pre>
<p>And second one to delete the value inside string array:</p>
<pre><code>db.collection.update({
  _id: &quot;5eff1a68c75aef6db2facdf8&quot;,

},
{
  $pull: {
    types: &quot;Tier1&quot;
  }
})
</code></pre>
<p>But I'd like do somthing like that:</p>
<pre><code>db.collection.aggregate([
  {
    $facet: {
      &quot;query1&quot;: [
        {
          // Update query
        }
      ],
      &quot;query2&quot;: [
        {
          // Delete query
        }
      ]
    }
  }
])
</code></pre>
<p>And in this way it would be possible get information about 'query1' and 'query2'.</p>
<p>For example: &quot;3 subdocuments updated and 1 type deleted&quot;</p>
<p>I don't know if is possible to do that into one single query.</p>
<p>Thanks.</p>

