MongoDB: How to default $count to 0 in a $facet when there is no matching criteria in aggregate<p>I am working on a complex pagination aggregate query and I am trying to see what Mongo is and isn't capable of doing. I followed this question <a href="https://stackoverflow.com/a/53220591/6000966">here</a>, and all works well except for when there is no data returned.</p>
<p>Mongo returns: <code>{ metadata: [], data: [] }</code>, but I want to see if it's possible to return</p>
<p><code>{ metadata: [ { count: 0 } ], data: [] }</code></p>
<p>for the Front-End to handle easier. So far I haven't been able to achieve this.</p>
<p>Here's a snippet of the <strong>$facet pipeline</strong> I'm using :</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;$facet&quot;: {
    &quot;metadata&quot;: [{
      &quot;$count&quot;: &quot;total&quot;
    }],
    &quot;data&quot;: [{
      &quot;$skip&quot;: 0
    }, {
      &quot;$limit&quot;: 10
    }]
  }
}
</code></pre>
<p>Of course this can be done after the query on the back-end, but I'm really wanting Mongo to handle it.</p>

