Getting a "not a function" error when trying to create a Signin with JWT<p><em>Disclaimer: this is my first project with react, mongo and js. I'm following a tutorial and trying to adapt it to my needs.</em></p>
<p>I'm trying to signin to a DB, get some values from a user and return them just so I know I managed to achieve a connection. I know that the credentials are being passed and are ok. When wrong credentials are passed instead, it works as intended and return an error.</p>
<p>I got reducers for 3 states: request, success and fail. In both success and fail the loading is set to false upon being changed to, but when I enter the correct credentials the loading remains on the screen. Meaning it probably got stuck during the request validation.</p>
<p><a href="https://i.stack.imgur.com/kdEA1.png" rel="nofollow noreferrer">Login Screen with XHR window</a></p>
<p>When looking through the terminal, this is the error that I get on the log.</p>
<blockquote>
<p>(node:13688) UnhandledPromiseRejectionWarning: TypeError: (0 , _util.default) is not a function
at _callee$ (C:\Users\Andor\Documents\GitHub\NaturaVARK\backend\routes/userRoute.js:18:16)
at tryCatch (C:\Users\Andor\Documents\GitHub\NaturaVARK\node_modules\regenerator-runtime\runtime.js:63:40)
at Generator.invoke [as _invoke] (C:\Users\Andor\Documents\GitHub\NaturaVARK\node_modules\regenerator-runtime\runtime.js:293:22)
at Generator.next (C:\Users\Andor\Documents\GitHub\NaturaVARK\node_modules\regenerator-runtime\runtime.js:118:21)
at asyncGeneratorStep (C:\Users\Andor\Documents\GitHub\NaturaVARK\backend\routes\userRoute.js:16:103)
at _next (C:\Users\Andor\Documents\GitHub\NaturaVARK\backend\routes\userRoute.js:18:194)
at processTicksAndRejections (internal/process/task_queues.js:93:5)<br />
at runNextTicks (internal/process/task_queues.js:62:3)
at processImmediate (internal/timers.js:434:9)</p>
</blockquote>
<p>I double checked both userRoute.js and util.js. Both are identical to the source code of the tutorial I'm following, went so far as to copy and paste them, just to be sure. The problems persists. The line that brings up the problem seem to be 18 and 16, those would be the token and email field at  res.send. I selected the relevant parts of the code and put here, as well as the repository link in case I might've missed something.</p>
<p>userRoute.js</p>
<pre><code>import express from 'express';
import User from '../models/userModel';
import getToken from &quot;../util&quot;;

    const router = express.Router();

    router.post('/signin', async (req, res) =&gt; {
        const signinUser = await User.findOne({
          email: req.body.email,
          password: req.body.password,
        });
        if (signinUser) {
          res.send({
            _id: signinUser.id,
            name: signinUser.name,
            email: signinUser.email,
            isAdmin: signinUser.isAdmin,
            token: getToken(signinUser),
          });
        } else {
          res.status(401).send({ message: 'Invalid Email or Password.' });
        }
      });

export default router;
</code></pre>
<p>util.js</p>
<pre><code>import jwt from 'jsonwebtoken';
import config from './config';
const getToken = (user) =&gt; {
  return jwt.sign(
    {
      _id: user._id,
      name: user.name,
      email: user.email,
      isAdmin: user.isAdmin,
    },
    config.JWT_SECRET,
    {
      expiresIn: '48h',
    }
  );
};

export { getToken };
</code></pre>
<p><a href="https://github.com/Mr-Andor/NaturaVARK" rel="nofollow noreferrer">Github Repository</a></p>
<p>Any insight is more than welcome.</p>

