In articles, there can be multiple tags.
Following is the article schema:</p>
<pre><code>const mongoose = require('mongoose');
const articleSchema = new mongoose.Schema({
    title: {
        type: String,
        required: true,
        trim: true
    },
    tags: [{
        type: mongoose.Schema.Types.ObjectId,
        required: true,
        ref: 'Tag'
    }]
}, {
    timestamps: true
});
const Article = mongoose.model('Article', articleSchema);
module.exports = Article;
</code></pre>
<p>Following is the tag schema:</p>
<pre><code>const mongoose = require('mongoose');
const tagSchema = new mongoose.Schema({
    title: {
        type: String,
        required: true,
        trim: true,
        unique: true
    }
}, {
    timestamps: true
});
const Tag = mongoose.model('Tag', tagSchema);
module.exports = Tag;
</code></pre>
<p>From these collections I wanted to show a simple column chart which shows
how many articles are there against a tag.
